const SSTheme = () => ({
  primary: '#E0004D',
  secondary: '#8BC400',
  tertiary: '#00965E',
  descriptionText: '#63666A',
});

const GLTheme = () => ({
  primary: '#702779',
  secondary: '#8BC400',
  tertiary: '#00965E',
  descriptionText: '#63666A',
});

export default {
  SS: SSTheme,
  GL: GLTheme,
};
